import React, { Component } from 'react';

class Input extends Component {
    render() {
        return (
            <div>
        <TextField
          id="standard-full-width"
          label=""
          style={{ margin: 8 }}
          placeholder=""
          helperText="Full width!"
          fullWidth
          margin="normal"
          InputLabelProps={{
            shrink: true,
          }}
        />
            </div>
        );
    }
}

export default Input;
